import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import PostService from "../services/post.service";
import AuthService from "../services/auth.service";

const EventDetails = () => {
  const { id } = useParams();
  const [eventDetails, setEventDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [formData, setFormData] = useState({
    name: "",
    description: "",
    place: "",
    date: "",
    maxParticipants: 0,
  });
  const user = AuthService.getCurrentUser();

  useEffect(() => {
    const fetchEventDetails = async () => {
      try {
        const response = await PostService.getEventById(id);
        setEventDetails(response.data);
        setFormData({
          name: response.data.name,
          description: response.data.description,
          place: response.data.place,
          date: response.data.date,
          maxParticipants: response.data.maxParticipants,
        });
        setLoading(false);
      } catch (error) {
        // Handle error
        setLoading(false);
        console.error("Error fetching event details:", error);
      }
    };

    fetchEventDetails();
  }, [id]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Send formData to update event details
      await PostService.updateEvent(id, formData);
      // Reload or navigate to another page as needed
    } catch (error) {
      // Handle error
      console.error("Error updating event details:", error);
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      {eventDetails && (
        <div className="card border-primary">
          <div className="card-header">{eventDetails.name}</div>
          <div className="card-body">
            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label htmlFor="eventName" className="form-label">Event Name</label>
                <input
                  type="text"
                  className="form-control"
                  id="eventName"
                  name="name"
                  value={formData.name}
                  onChange={handleInputChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="eventDescription" className="form-label">Event Description</label>
                <textarea
                  className="form-control"
                  id="eventDescription"
                  name="description"
                  value={formData.description}
                  onChange={handleInputChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="eventPlace" className="form-label">Event Place</label>
                <input
                  type="text"
                  className="form-control"
                  id="eventPlace"
                  name="place"
                  value={formData.place}
                  onChange={handleInputChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="eventDate" className="form-label">Event Date</label>
                <input
                  type="date"
                  className="form-control"
                  id="eventDate"
                  name="date"
                  value={formData.date}
                  onChange={handleInputChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="eventMaxParticipants" className="form-label">Max Participants</label>
                <input
                  type="number"
                  className="form-control"
                  id="eventMaxParticipants"
                  name="maxParticipants"
                  value={formData.maxParticipants}
                  onChange={handleInputChange}
                />
              </div>
              <button type="submit" className="btn btn-primary">Save Changes</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default EventDetails;
